import Genre from "./Genre.jsx";
import styles from "../App.module.css";

function GenreList() {
	const genres = Genre();
	return (
		<div className={styles.genre}>
		<ul>
		{genres.map(genre => <li key={genre.title}> <img className={styles.genreimage} src={genre.image}/>{genre.title}</li>)}
		</ul>
		</div>
	);
};

export default GenreList;
